  const validate = (destination) => {
    if (!destination) return "Destination is required"
    return true;
  }

  return (
    <SelectControlField
      name="Swap to"
      id="destination"
      label="Swap to"
      fullWidth
      defaultValue=""
      variant="standard"
      control={control}
      options={TokenOptions}
      rules={{
        required: 'Destination is required',
        validate

      }}
    />
  )
}
export default DestinationField
